import AxiosClient from './AxiosClient'


const getToken = (): Promise<string> => {
    try {
        const response = AxiosClient.post('/auth', { apiKey: "23567b218376f79d9415" })
        debugger
        return response.data.token
    } catch (error) {
        throw Error(error)
    }
}

export default getToken
